import Header from "./components/Header";
import Body from "./components/Body";
import Nav from "./components/Nav";
const App = () => {
  return (
    <div>
      <div className="header-div">
        <Header />
        <div className="nav">
          <Nav />
        </div>
        <Body />
      </div>
    </div>
  );
};

export default App;
